import styled, { createGlobalStyle } from "styled-components";
const GlobalStyle = createGlobalStyle`

*{
    box-sizing:border-box;
    padding:0;
    margin:0;
}

`;

export const Container = styled.div`
  z-index: 1;
  width: 100%;
  max-width: 1300px;
  margin-right: auto;
  padding-left: 50px;
  padding-right: 50px;
  margin-left: auto;

  @media screen and (mex-width) {
    padding-left: 30px;
    padding-right: 30px;
  }
`;

export default GlobalStyle;
